- (void)drawPaths:(NSMutableArray *)arrayOfPaths
{
    
    for (NSDictionary *pathInfo in arrayOfPaths) {
        UIBezierPath *path = pathInfo[PATH];
        UIColor *color = pathInfo[FILL_COLOR];
        [color setFill];
        [path fill];
    }
    
}

- (void)drawCurrentOptionsInDrawOrder:(NSArray *)drawOrder
{
    for (NSString *key in drawOrder) {
            CHAvatarAttributeOption *option = self.currentOptions[key];
            [self drawPaths:option.paths];
    }
}


