    [strokePath moveToPoint: CGPointMake(67.05, 66.05)];
    [strokePath addCurveToPoint: CGPointMake(67.05, 13.95) controlPoint1: CGPointMake(81.43, 51.66) controlPoint2: CGPointMake(81.43, 28.34)];
